import React from 'react'
import { useLocation } from 'react-router-dom'
import { Typography } from '@mui/material'
import Confetti from 'react-confetti-boom';

import '../App.css'
import LinkButton from '../components/LinkButton'


const QuizComplete = () => {
    const calculatedCar = useLocation().state.carSuccess;
    const carName = calculatedCar.Name;
    const carLink = calculatedCar.Link;
    const carPicture = calculatedCar.Picture;
    const carDescription = calculatedCar.Description;

    return (
        <div className="App">
            <header className="App-content">
                <p>
                The quiz is complete!
                Here is your car!
                </p>
                {carName}
                <img 
                    src={carPicture} 
                    alt={carName}
                    width='70%'                    
                />
                <Typography fontSize='25px'>
                    {carDescription}
                </Typography>
                <div>
                    {carLink}
                </div>
                <LinkButton to='/quiz' text='Restart Quiz'/>
            </header>
        </div>
    )
}

export default QuizComplete
